import userEvent from "@testing-library/user-event";
import React from "react";
import  data  from "./data.json"

function App() {
  return (
    <div>
      {data.map(function(d, idx){
         return (<li key={idx}>{d.title}</li>)
       })}
      </div>
  );
}

export default App;
